// LogoutButton.js
import React from 'react';

const LogoutButton = ({ setLoggedIn }) => {
  const handleLogout = () => {
    localStorage.removeItem('accessToken');
    setLoggedIn(false);
  };

  return (
    <button onClick={handleLogout}>Logout</button>
  );
};

export default LogoutButton;
